import React from 'react';
import hc from './Header.module.css'
import {NavLink} from "react-router-dom";
import LoginModalWindow from "../ModalWindow/LoginModal"



const Header = (props) => {
    return <header className={hc.header}>
        <div className={hc.item}>
            {props.IsLogined
                ? <div >{props.login}<div>
                    <button onClick={props.LogOutThunk} className={hc.log}>
                        Logout
                    </button>
                </div>
            </div>
                :
            <LoginModalWindow />}
        </div>
    </header>

}
export default Header;
